content:
Only one bowl out of Nemo consumed at 2:24pm.

Harsh rip o.O

@2:33...but the harshness was worth is. Creeping high but mellow.

Acquired from private grow in Costa Mesa, CA.
Smoked at 4:04pm.
Great taste and mellow come up. Head up mostly.  
Update @ 4:11pm  finished first bowl with a great head buzz keeping me energetic.
@4:14  got craziest headrush of my life of a small but good hit. Lost vision and head got very warm. Going to continue with smoking.
@5:10-20 i plan to hit my last bowl. i am still buzzin pretty good and its an hour into the session so im happy with it. Feel great, and the bud was cheap was hell ;p always keepin it cheap. Grower was a very interesting man as well.
